import React, { Component } from 'react';

var Columns = require('react-columns');

class Header extends Component {
    render() {
        return (
            <div className="header" style = {styles.div}>
                <Columns col="2">
                    Quick Math
                </Columns>

            </div>
        );
    }
}

let styles = {
    div:{
        background: 'blue',
        color: 'white',
        fontSize: 60
    }
}

export default Header;
